import React from "react";
import style from "./TodoItem.module.css";

const TodoItem: React.FC<{ text: string; onDeleteTodoItem: () => void }> = (
  props
) => {
  return (
    <>
      <div className={style.item}>
        <li>{props.text}</li>
      </div>
      <button onClick={props.onDeleteTodoItem}>del</button>
    </>
  );
};

export default TodoItem;
